rance Co., \r\nEnvironment\r\n.Net, Oracle 9i\r\nTesting Tools\r\nManual, QC\r\nPeriod\r\nNov 2016 to Sep 2017\r\n\r\nDescription: This System aimed to cater to the needs of the Insurance sector. It is a web-based product with a comprehensive illustration system, sales tool kit with downloadable feature, back office module, premium calculator and an application to control and maintain the Financial Advisors (also known as agents) information. This system aims in sales promotion and generates illustrated reports based on the data collected from the customer.\r\n\r\nResponsibilities:\r\n\r\nAnalyzed user requirements and developed test cases.\r\nCreated Test Scenarios and executed them.\r\nCreated defect report and discussed with the team members about the defects\r\nWorked closely with user to understand the requirements.\r\nParticipated in weekly team meetings for tracking the progress of project.\r\nDocumentation of the test results.\r\n\r\n\r\n\r\nProject # 3\r\nTitle\r\nClin Aid Healthcare System\r\nClient\r\nBAPCO Hospital \r\nEnvironment\r\nJSP, EJB, Swing, XML, Servlets, Oracle 9i\r\nTesting Tools\r\nManual, LR, QC\r\nPeriod\r\nFeb 2016 to Sep 2016\r\n\r\nDescription: This project is being developed on total automation of Hospital Management. This package is for their health care center, which takes care of the various aspects of Hospital Management like Billing, Lab, Discharge, Appointment, payroll, registration etc., \r\n\r\nResponsibilities:\r\n\r\nUnderstanding the Requirements Specification.\r\nActive participation in weekly meetings.\r\nCreated defect report and discussed with the team members about the defects.\r\nPreparation of Documents.\r\nInvolved in weekly meetings for tracking the progress of project.\r\nWorked closely with user to understand the requirements.\r\n\r\n\r\nProject # 4\r\nTitle\r\nCeltiCare \r\nClient\r\nCeltic Insurance Co.\r\nEnvironment\r\nJava, JSP, EJB, Oracle 9i\r\nTesting Tools\r\nManual, LR, QC\r\nPeriod\r\nApr 2015 to Dec 2015\r\n\r\nDescription: Celtic is a major provider of individual health plans nationwide. They offer quality coverage insurance needs for kids, individuals and families in all stages of life. The expansive Celtic Product portfolio includes CeltiCare Health Plan for individuals, families, Kids Health Plan and the Celtic Short-term Health Plan.\r\n\r\nResponsibilities:\r\n\r\nStudy and Analysis of the Business Requirements.\r\nCreated Test Scenarios and executed them.\r\nCreated defect report and discussed with the team members about the defects.\r\nDocumentation of the test results.\r\nInteract with development team for fixing the bugs.\r\n\r\n\r\n\r\n\r\n\r\n\r\nProject # 5\r\nTitle\r\nMedPlexus (HealthCare ASP)\r\nClient\r\nMedPlexus \r\nEnvironment\r\nJSP, Swing, EJB, XML, Servlets, Oracle 9i\r\nTesting Tools\r\nManual, QC\r\nPeriod\r\nJuly 2014 to Mar 2015\r\n\r\nDescription: A Client/Server application, developed for MedPlexus. The client of this project is one of the biggest Hospitals located in USA. This package is for their health care center, which takes care of the various aspects of Hospital Management. The following are the modules included for the release of the software.\r\n1. Registration\r\n2. Appointment Booking\r\n3. Transfer and Discharge\r\n4. HR and Payroll\r\n5. Security Administration\r\n6. Lab\r\n7. Billing\r\n\r\nResponsibilities:\r\nAnalyzed Business Requirements Specification.\r\nInteract with user to understand the requirements.\r\nCreated Test Cases and executed them manually.\r\nCoordinated with the development team for fixing the bugs.\r\nParticipated in weekly meetings for review of the project.\r\n\r\nProject # 6\r\nTitle\r\nDrugs Distribution System\r\nClient\r\nGland Pharma.\r\nEnvironment\r\nVB 6.0, Oracle 9i\r\nTesting Tools\r\nManual, QC\r\nPeriod\r\nSep 2013 to Apr 2014\r\n\r\nDescription: Drugs Distribution System comprehensively covers all the aspects of the organization like Supplier Details, Customer Details, Item Details, Pu